import React, { Component } from "react";

export default class BottomNavbar extends Component {
  render() {
    return (
      <div>
        <nav class="navbar navbar-expand-md py-5 navbar-dark bg-dark navbar-fixed-bottom">
          <div class="container-fluid justify-content-center">
          <p class="text-secondary">Powered By: </p><a class="dropdown-item text-light bg-dark" href="#" className="bottom-nav"> Auditions </a>
          </div>
        </nav>
      </div>
    );
  }
}
